import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-profile',
  templateUrl: `./profile.component.html`,
  styleUrls: ['./profile.component.scss'],
})
export class ProfileComponent  implements OnInit {

  userName: string = 'Azwan Ali';
  userImage: string = 'https://cdn.beautifulnara.net/wp-content/uploads/2020/01/15154604/azwan-ali-1.jpg';

  constructor() { }

  ngOnInit() {}

}
<ion-content>
  <ion-card>
    <ion-card-content>
      <div class="profile-container">
        <ion-img
          src="{{ userImage }}"
          alt="User Image"
        >
        </ion-img>
        <h2 class="profile-name">{{ userName }}</h2>
        <ion-grid>
          <ion-row>
            <ion-col>1</ion-col>
            <ion-col>2</ion-col>
            <ion-col>3</ion-col>
          </ion-row>
        </ion-grid>
      </div>
    </ion-card-content>
  </ion-card>
</ion-content>
